import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <div className="header">
        <h2 className="logo">Ag-Pub</h2>
        <input type="checkbox" id="chk"/>
        <label for="chk">
        <i class="fas fa-bars"></i>
        </label>
      </div>
    );
  }
}

export default Navbar;
